import React from 'react';
import PropTypes from 'prop-types';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import { Person, ThreeDRotation } from '@material-ui/icons';

export default function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Grid container spacing={1}>
    <Grid style={{height:'50px'}}item sm={4} xs={12}>
        <Grid container justify="center" spacing={0} >
            <Grid item xs={4}>
                <Person style={{ width: '100%', textAlign: 'right' }}/>
            </Grid>
             <Grid item xs={8}>
                 <Typography >333</Typography>        
            </Grid>
            <Grid item xs={12}>
                 <Typography style={{ width: '100%', textAlign: 'center' }}>Ogrenci</Typography>        
            </Grid>
        </Grid>      
    </Grid>
    </Grid>


  );
}

TabPanel.propTypes = {
  children: PropTypes.node,

};
